import React, { useState } from 'react';
import styled from 'styled-components';
import Logo from '../assets/Logo Escrito 2 Branco PNG.png';
import { useNavigate, Link } from 'react-router-dom';

const BackgroundContainer = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    background: #ffffff; /* Alterado para branco */
    min-height: 100vh;
`;

const FormWrapper = styled.div`
    background: #ffffff; /* Alterado para branco */
    border: 2px solid rgba(0, 0, 0, .2); /* Alterado para preto */
    box-shadow: 0 0 10px rgba(0, 0, 0, .2);
    color: #000000; /* Alterado para preto */
    width: 420px;
    border-radius: 10px;
    padding: 30px 40px;
`;

const LogoImage = styled.img`
    display: block;
    margin: 0 auto;
    width: 200px; /* Tamanho ajustado */
`;

const RegisterLink = styled.div`
    text-align: center;
    margin-top: 20px;
`;

const RegisterText = styled.p`
    font-size: 16px;
    margin-bottom: 10px;
`;

const RegisterLinkList = styled.div`
    display: flex;
    justify-content: space-between;
`;

const RegisterLinkItem = styled(Link)`
    display: inline-block;
    color: #007bff; /* Cor ajustada */
    text-decoration: none;
    margin-bottom: 5px;
    font-weight: bold;
    margin-right: 10px; /* Espaçamento ajustado */
`;

const InputBox = styled.div`
    position: relative;
    margin: 30px 0;
`;

const Input = styled.input`
    width: 100%; 
    height: 50px;
    background: transparent;
    outline: none;
    border: 2px solid rgba(0, 0, 0, .2); /* Alterado para preto */
    border-radius: 40px;
    font-size: 16px;
    color: #000000; /* Alterado para preto */
    padding-left: 20px;
`;

const RememberForgot = styled.div`
    display: flex;
    justify-content: space-between;
    align-items: center;
    font-size: 14px;
    margin: -15px 0 15px;
`;

const RememberForgotLabel = styled.label`
    display: flex;
    align-items: center;
`;

const RememberForgotInput = styled.input`
    margin-right: 4px;
`;

const RememberForgotLink = styled(Link)`
    color: #007bff; /* Cor ajustada */
    text-decoration: none;
`;

const LoginButton = styled.button`
    width: 100%;
    height: 45px;
    border: none;
    outline: none;
    border-radius: 40px;
    box-shadow: 0 0 10px rgba(0, 0, 0, .1);
    cursor: pointer;
    font-size: 16px;
    color: #ffffff; /* Alterado para branco */
    font-weight: 700;
    background: #FAAF83;
    transition: background 0.3s;
`;

const Login = () => {
    const navigate = useNavigate();
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const handleLogin = (e) => {
        e.preventDefault();
        if (email && password) {
            navigate('/feed');
        } else {
            alert('Por favor, preencha todos os campos.');
        }
    };

    return (
        <BackgroundContainer>
            <FormWrapper>
                <form onSubmit={handleLogin}>
                    <LogoImage src={Logo} alt="Logo" />
                    <h1>Bem-vindo de volta!</h1>
                    <RegisterLink>
                        <RegisterText>Não tem uma conta? Cadastre-se:</RegisterText>
                        <RegisterLinkList>
                            <RegisterLinkItem to='/Cadastro'>Usuário</RegisterLinkItem>
                            <RegisterLinkItem to='/CadastroOng'>ONG</RegisterLinkItem>
                        </RegisterLinkList>
                    </RegisterLink>
                    <InputBox>
                        <Input 
                            type='email' 
                            placeholder='Digite seu email' 
                            required 
                            value={email} 
                            onChange={(e) => setEmail(e.target.value)} 
                        />
                    </InputBox>
                    <InputBox>
                        <Input 
                            type='password' 
                            placeholder='Digite sua senha' 
                            required 
                            value={password} 
                            onChange={(e) => setPassword(e.target.value)} 
                        />
                    </InputBox>
                    <RememberForgot>
                        <RememberForgotLabel>
                            <RememberForgotInput type='checkbox' />Lembre-me
                        </RememberForgotLabel>
                        <RememberForgotLink to='/forgot-password'>Esqueceu sua senha?</RememberForgotLink>
                    </RememberForgot>
                    <LoginButton type="submit">Entrar</LoginButton>
                </form>
            </FormWrapper>
        </BackgroundContainer>
    );
};

export default Login;
